import React from 'react'

const Signup = () => {
  return (
    <Template
      title="Welcome Back"
      description1 = "Build skills for today, tomorrow, and beyond."
      description2 = "Education to future-proof your career"
      image={loginImg}
      formtype="login"
      setIsLoggedIn={setIsLoggedIn}
    />
  )
}

export default Signup
